import LoginForm from '../../Public/Components/LoginForm'

function Login() {
    return (
        <div className=" h-screen flex md:flex-row flex-col m-auto">
            <form className="mt-8 space-y-6" onSubmit={
                e=>{
                    e.preventDefault()
                    console.log(e.target[1].value)
                }
            }>
            <LoginForm />
            </form>
        </div>
    )
}

export default Login
